import "../styles/navBar.scss";
import logo from "../images/logo.png";

function NavBar() {
  return (
    <div className="navBar">
      <div className="container">
        <div className="logo-container">
          <img src={logo} />
        </div>
      </div>
    </div>
  );
}
export default NavBar;
